e Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\n# from deisa import Deisa\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"axis":{"id":"1016"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1019","type":"Grid"},{"attributes":{"coordinates":null,"formatter":{"id":"1473"},"group":null,"major_label_policy":{"id":"1474"},"ticker":{"id":"1127"}},"id":"1126","type":"LinearAxis"},{"attributes":{"data":{"cpu":{"__ndarray__":"AAAAAACAOUBmZmZmZmYgQAAAAAAAABBAAAAAAAAAMEAAAAAAAIA7QGZmZmZmZhhAAAAAAAAAEEAAAAAAAAAwQGZmZmZmZj1AZmZmZmZmEEAAAAAAAAAQQAAAAAAAADJAAAAAAACAO0BmZmZmZmYYQAAAAAAAABBAAAAAAAAAMkAAAAAAAIA5QGZmZmZmZhhAAAAAAAAAGEAAAAAAAAAwQM3MzMzMzDdAAAAAAAAAEEAAAAAAAAAgQAAAAAAAADJAAAAAAACAOUBmZmZmZmYYQAAAAAAAABBAAAAAAAAAMkAzMzMzM7M3QDMzMzMzMyBAAAAAAAAAEEAAAAAAAAAwQDMzMzMzsztAAAAAAADgWEDNzMzMzMwtQAAAAAAAADJAAAAAAACARkBmZmZmZmZEQM3MzMzMDE9AmpmZmZkZPkAAAAAAAAAwQAAAAAAAABBAAAAAAAAAGEDNzMzMzEw+QJqZmZmZmUJAZmZmZmZmIEAzMzMzM/NEQDMzMzMz80hAAAAAAABAUkCamZmZmVlHQAAAAAAAACRAAAAAAAAAGEAAAAAAAAAoQAAAAAAAACBAAAAAAAAAR0AAAAAAAAAyQDMzMzMzMz9AAAAAAACAREAzMzMzM/NRQJqZmZmZGUVAAAAAAAAALEAAAAAAAAAgQAAAAAAAABBAAAAAAAAAR0BmZmZmZmY7QGZmZmZmZiBAAAAAAAAARUCamZmZmflSQAAAAAAAAElAAAAAAAAAGEAAAAAAAAAQQAAAAAAAABhAAAAAAACATUBmZmZmZmYYQAAAAAAAACxAMzMzMzPzSkCamZmZmRlKQAAAAAAAABhAAAAAAAAAMkDNzMzMzIxSQGZmZmZm5ktAAAAAAAAARkAAAAAAAAAYQAAAAAAAABBAZmZmZmZmTEBmZmZmZmYYQAAAAAAAADxAAAAAAAAATkCamZmZmXlXQM3MzMzMDEhAAAAAAAAAQkAAAAAAAAAQQAAAAAAAACxAAAAAAAAASEAAAAAAAAAYQDMzMzMz80dAMzMzMzNTUEBmZmZmZiZVQJqZmZmZGUVAAAAAAAAAJEAAAAAAAAAsQM3MzMzMjERAZmZmZmZmJEAAAAAAAAAwQDMzMzMzs05AZmZmZmYmUUAAAAAAAABUQAAAAAAAAEtAAAAAAAAAMEAAAAAAAAAYQM3MzMzMDEhAAAAAAAAAMEBmZmZmZmY9QGZmZmZmZkZAMzMzMzOTUkAAAAAAAABQQAAAAAAAAENAAAAAAAAAGEAAAAAAAAAYQAAAAAAAAEpAZmZmZmZmO0DNzMzMzEw0QGZmZmZm5k5AZmZmZmYmUkBmZmZmZuZRQM3MzMzMDEBAAAAAAAAAEEAAAAAAAAAQQM3MzMzMTExAZmZmZmZmIEAAAAAAAABBQAAAAAAAgFFAMzMzMzNzVEDNzMzMzAxDQAAAAAAAADBAAAAAAAAAEEBmZmZmZuZFQJqZmZmZmSNAAAAAAAAAGEAAAAAAAABHQGZmZmZmxlFAmpmZmZm5UEBmZmZmZuZKQJqZmZmZGTpAZmZmZmbmQkCamZmZmXlYQA==","d
